import React, { Component } from 'react';
import "./css/skills.css"
import Skill from "./Skill"

export default class Skills extends Component {

    render() {

        let listClass = "flex-horizontal space-between list-element"

        return (
            <div>
            <h3>Skills</h3>
         
                <li className={listClass} ><Skill logosrc="jsLogo.svg" desc="Javascript" /> <Skill logosrc="nodeJSLogo.svg"/></li>
                <li className={listClass}><Skill logosrc="pyLogo.svg" /> <Skill logosrc="djangoLogo.svg" /> </li>
                <li className={listClass}><Skill logosrc="cHashLogo.svg"/> <Skill logosrc="unityLogo.svg" /></li>
                
           
            </div>
        )
    }
}
